Promotional info for the collected edition - &quot;He's back! Osamu Tezuka's beloved Astro Boy continues his amazing return to comics in the official adaptation of his exciting feature film debut in 2009! Set in futuristic Metro City, Astro Boy is about a young robot with incredible powers created by a brilliant scientist, powered by positive energy, and endowed with super strength, x-ray vision, unbelievable speed, and the ability to fly. Embarking on a journey in search of acceptance, Astro Boy encounters many other colorful characters along the way. Through his adventures, he learns the joys and emotions of being human, and gains the strength to embrace his destiny. Ultimately learning his friends and family are in danger, Astro Boy marshals his awesome super powers and returns to Metro City in a valiant effort to save everything he cares about and to understand what it takes to be a hero.&quot;

This is all four issues of the series; the first is by HFB-CPS and the next three are by Thundarr-Bunny-CPS. Thanks to all the scanners for their efforts; please seed, and enjoy. 

